import React from 'react';
import 'tachyons';

const Card = (props) => {
    return (
        <div className='tc bg-purple dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt='robots' src={`https://robohash.org/${props.id}?200x200`}/>
            <div>
                <h2>{props.name}</h2>
                <h3>{props.email}</h3>
            </div>
        </div>
    );
}
export default Card;
